import { Injectable } from '@angular/core';
// import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root'
})
export class ApiService {

  constructor(
    public http: HttpClient
  ) { }

  showProfile(data){
    return this.http.post('http://localhost/Projects/testePHP/backend/create.php', data);
  }
}
